  [],\n\t\"revision_timestamp\": \"2016-07-27T23:06:24.609188\",\n\t\"name\": \"southern-great-plains-rapid-ecoregional-assessment-pre-assessment-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of the Pre-Assessment Report
  for the Southern Great Plains Rapid Ecoregional Assessment (REA) is to document
  the selection process for and final list of Conservation Elements, Change Agents,
  and Management Questions developed during Phase I. The overall goal of the REAs
  being conducted for the Bureau of Land Management (BLM) is to provide information
  that supports regional planning and analysis for the management of ecological resources.
  The REA provides an assessment of baseline ecological conditions, an evaluation
  of current risks from drivers of ecosystem change, and a predictive capacity for
  evaluating future risks. The REA also may be used for identifying priority areas
  for conservation or restoration and for assessing the cumulative effects of a variety
  of land uses. There are several components of the REAs. Management Questions, developed
  by the BLM and partners for the ecoregion, identify the information needed for addressing
  land-management responsibilities. Conservation Elements represent regionally significant
  terrestrial and aquatic species and communities that are to be conserved and (or)
  restored. For each Conservation Element, key ecological attributes will be evaluated
  to determine the status of each species and community. The REA also will evaluate
  major drivers of ecosystem change, or Change Agents, currently affecting or likely
  to affect the status of Conservation Elements in the future. The relationships between
  Change Agents and key ecological attributes will be summarized using conceptual
  models. The REA process is a two-phase process. Phase I (pre-assessment) includes
  developing and finalizing the lists of priority Management Questions, Conservation
  Elements, and Change Agents, culminating in the REA Pre-Assessment Report. Chapter
  1 provides an overview of the REA process. Chapter 2 describes the biophysical and
  anthropogenic features of the Southern Great Plains, and Chapter 3 explains the
  process used to identify Conservation Elements, Change Agents and Management Question's.
  The remaining chapters each feature one of 19 Conservation Elementsu20146 ecological
  communities and 13 species (including 2 species assemblages)u2014to be addressed
  in Phase II. For each Conservation Element, we will address the four primary Change
  Agentsu2014development, fire, invasive species, and climate changeu2014required
  for the REA. In addition, we will evaluate insect pests and disease for particular
  Conservation Elements. Development includes effects related to energy and infrastructure,
  agricultural activities, and other human activities, including urbanization and
  recreation. An overview on the ecology and management issues for each Conservation
  Element is provided, including distribution and ecology, landscape structure and
  dynamics, and associated species of management concern affiliated with each Conservation
  Element. For each Conservation Element, effects of the Change Agents are described.
  An overview of potential key ecological attributes and potential Change Agents are
  summarized by conceptual models and tables. The tables provide an organizational
  framework and background information for evaluating the key ecological attributes
  and Change Agents in Phase II.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
